    const [genNumber, setGenNumber] = useState("1")
    async function generation () {
        try{
            const gen = await axios.get(`https://pokeapi.co/api/v2/generation/${genNumber}`);
            console.log(gen.data)
        }
        catch(error){
            console.log("generation",error);
        }
    }
